import React from 'react'
import Header from './Header'
// import Card  from './Card';
import './Home.css';
// import {Link} from 'react-router-dom';
import details from '../pages/datasetHotels.json';

function Home(){
  return (
    <div>
        <Header/>
        <div className='home_section'>
            {
                details && details.map( detail =>{
                    return(
                        <div className='hotel' key={detail.id}>
                            <img src={detail.image} alt='' style={{}}/>
                            <br/>
                            <div className='hotel_info'>
                                <h2>{detail.title}</h2>
                                <h4>{detail.description}</h4>
                            </div>
                            <div className='hotel_button'>
                                <button>See Rooms</button>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    </div>
  )
}
export default Home
